{'stockSymbol': None, 'type': 'Other', 'name': 'X', 'desc': "X (named ex , plural exes) is the 24th and antepenultimate letter in the modern English alphabet and the ISO basic Latin alphabet.


== History ==
In Ancient Greek, '' and '' were among several variants of the same letter, used originally for /k/ and later, in western areas such as Arcadia, as a simplification of the digraph '' for /ks/."}

{'stockSymbol': None, 'type': 'Other', 'name': 'Chinas', 'desc': 'The Chinas or Chna (Sanskrit :) are a people mentioned in ancient Indian literature from the first millennium BC, such as the Mahabharata, Laws of Manu, as well the Puranic literature.


== Etymology ==
The name "Cina" is commonly believed to have been derived from the Qin (Tsin or Chin in older transliterations) dynasty which ruled in China from 221 BC, or the preceding state of Qin which existed since the 9th century BC. The Greco-Romans referred to China as Sina, or Sinae.'}

